import LandingPage from "./components/LundingPage/LandingPage";

function App() {
  return (
    <Switch>
      <Route exact path="/">
        <LandingPage />
      </Route>
      <Route ma>
        <Index />
      </Route>
    </Switch>
  );
}

export default App;
